import React from 'react';


function Feedback(){
    return(
        <>
        
        <form>
        <input name="title" placeholder="Title" />
        <textarea name="content" placeholder="Take a note..." rows="3" />
        <button>Add</button>
      </form>
        </>
    )
}

export default Feedback;
